// validate (ensure exported C++ functions exist before calling them)
static int _Scribe_RcppExport_validate(const char* sig) { 
    static std::set<std::string> signatures;
    if (signatures.empty()) {
        signatures.insert("NumericMatrix(*kde_cpp)(NumericMatrix,int,int,int,int)");
        signatures.insert("NumericMatrix(*kde)(SEXP,SEXP,SEXP,SEXP,SEXP)");
        signatures.insert("List(*knn_density)(SEXP,SEXP,SEXP)");
        signatures.insert("NumericMatrix(*knn_density_2d)(SEXP,SEXP,SEXP,SEXP)");
        signatures.insert("double(*digamma_0)(double)");
        signatures.insert("double(*vd)(SEXP)");
        signatures.insert("double(*entropy)(SEXP,SEXP)");
        signatures.insert("double(*mi)(SEXP,SEXP,SEXP,SEXP)");
        signatures.insert("List(*cmi)(SEXP,SEXP,SEXP,SEXP,SEXP)");
        signatures.insert("List(*ucmi_cpp)(const NumericMatrix&,const NumericMatrix&,NumericMatrix,int,int,int,double)");
        signatures.insert("List(*ucmi)(SEXP,SEXP,SEXP,SEXP,SEXP,SEXP,SEXP)");
        signatures.insert("double(*umi_cpp)(const NumericMatrix&,const NumericMatrix&,int,int,int,double)");
        signatures.insert("double(*umi)(SEXP,SEXP,SEXP,SEXP,SEXP,SEXP)");
    }
    return signatures.find(sig) != signatures.end();
}

