    R_RegisterCCallable("Scribe", "_Scribe_kde_cpp", (DL_FUNC)_Scribe_kde_cpp_try);
    R_RegisterCCallable("Scribe", "_Scribe_kde", (DL_FUNC)_Scribe_kde_try);
    R_RegisterCCallable("Scribe", "_Scribe_knn_density", (DL_FUNC)_Scribe_knn_density_try);
    R_RegisterCCallable("Scribe", "_Scribe_knn_density_2d", (DL_FUNC)_Scribe_knn_density_2d_try);
